import "./../../css/style.css";
import "./../../css/bootstrap.min.css"
import { Button } from "primereact/button";

function Graph() {
  return (
    <div>
      <h2 className="mb-4">
        <b>Graphs</b>
      </h2>
      <div className="field col-6">
        <br></br>
        <p>
          <Button></Button>
        </p>
      </div>
      <div className="field col-6">
        <br></br>
        <p>
          <Button></Button>
        </p>
      </div>
    </div>
  );
}

export default Graph;
